      cudaMemcpy(gpu_Xin, (void *)&Xin[0], 4000UL, cudaMemcpyHostToDevice);
      notNaN = false;
    }

    if (rv_dirtyOnCpu) {
      cudaMemcpy(gpu_rv, &rv[0], 85344UL, cudaMemcpyHostToDevice);
      rv_dirtyOnCpu = false;
    }

    cublasSdot(getCublasGlobalHandle(), 1000, (float *)&(*gpu_Xin)[0], 1, (float
                *)&(*gpu_rv)[idx].Beta[0], 1, (float *)gpu_y);
    cudaMemcpy(&b_y, gpu_y, 4UL, cudaMemcpyDeviceToHost);
    f = b_y + rv[idx].Bias;
    for (c = 0; c < 2; c++) {
      scores[c] = -f;
      jj = c;
    }

    scores[jj] = f;
    pscore[idx] = scores[1];
  }

  for (jj = 0; jj < 7; jj++) {
    b_y = 0.0F;
    c = 0;
    for (idx = 0; idx < 21; idx++) {
      f = 1.0F - static_cast<float>(M[jj + 7 * idx]) * pscore[idx];
      if ((0.0F > f) || rtIsNaNF(f)) {
        f = 0.0F;
      }

      if (!rtIsNaNF(f)) {
        b_y += f;
        c++;
      }
    }

    if (c == 0) {
      b_y = rtNaNF;
    } else {
      b_y /= static_cast<float>(c);
    }

    f = -(b_y / 2.0F);
    negloss[jj] = f;
    b[jj] = rtIsNaNF(f);
  }

  notNaN = true;
  jj = 0;
  exitg1 = false;
  while ((!exitg1) && (jj <= 6)) {
    if (!b[jj]) {
      notNaN = false;
      exitg1 = true;
    } else {
      jj++;
    }
  }

  notNaN = !notNaN;
  idx = 0;
  ex = 0.019064124783362217;
  for (jj = 0; jj < 6; jj++) {
    if (ex < obj_Prior[jj + 1]) {
      ex = obj_Prior[jj + 1];
      idx = jj + 1;
    }
  }

  f = rtNaNF;
  if (notNaN) {
    c = 1;
    f = negloss[0];
    for (jj = 0; jj < 6; jj++) {
      if ((!rtIsNaNF(negloss[jj + 1])) && (rtIsNaNF(f) || (f < negloss[jj + 1])))
      {
        f = negloss[jj + 1];
        c = jj + 2;
      }
    }

    f = static_cast<float>(c);
  }

  *labels = obj_ClassNames[idx];
  if (notNaN) {
    if (f < 4.2949673E+9F) {
      jj = static_cast<int>(f);
    } else {
      jj = 0;
    }

    *labels = obj_ClassNames[jj - 1];
  }

  cudaFree(*gpu_rv);
  cudaFree(*gpu_Xin);
  cudaFree(gpu_y);
}

